import { Component} from "react";
import { Button,Tooltip } from 'antd';
class Square extends Component{
  constructor(props) {
    super(props);
  }
  render(){
    return (
      <Tooltip title="search">
        <Button type="primary" shape="circle" icon={<SearchOutlined />} />
      </Tooltip>
    )
  }
}
export default Square
